import React from "react";
import ReactDOM from "react-dom";
import Submit from "../Submit/Submit"
import axios from "axios";
var inputStyle = {
  "border-radius": "15px",
  width: "300px",
  marginTop: "25px",
  height: "30px",
  "text-align": "center",
  marginLeft: "15%",
  "background-color": "lightblue"
};
var containerStyle = {
  "border-radius": "20px",
  width: "40%",
  left: "25%",
  top: "10%",
  position: "absolute",
  "text-align": "center",
  padding: "20px",
  "background-color": "tomato"
};
var headStyle = {
  "font-size": "25px",
  border: "3px solid black",
  height: "30px",
  "text-align": "center",
  "background-color": "aqua"
};
class Register extends React.Component {
  constructor()
  {
    super();
    this.state = {
      data : null,
      isDataLoaded : false,
      nume : "",
      prenume : "",
      password : "",
      confirmareparola : "",
      nr_telefon : "",
      link_poza : "",
      email : ""
    }
  }
  loadData = () => {
    axios.get("http://localhost:3005/users")
    .then(req => {
      this.setState({
        isDataLoaded : true,
        data : req.data
      })
    })
  }
  componentDidMount(){
    this.loadData();
    this.setState({
      timer : setInterval(this.loadData,500)
    })
  }
  componentWillUnmount() {
    clearInterval(this.state.timer);
  }
  uploadData = (e) => {
    this.setState({
      [e.target.id] : e.target.value
    });
  }
  newRegister = () => {
    if(this.state.nume === "" || this.state.prenume === "" || this.state.password === "" || this.state.confirmareparola === "" || this.state.nr_telefon ==='' || this.state.link_poza ==="" || this.state.email === "")
    {alert("Unul dintre campuri este gol");
    return 0;
}
else if(this.state.nume === undefined || this.state.prenume === undefined || this.state.password === undefined || this.state.confirmareparola === undefined || this.state.nr_telefon ==='' || this.state.link_poza ===undefined || this.state.email === undefined)
{
    alert("Nu ai introdus corect datele intr-unul din campuri!");
    return 0;
}
else {
  axios.post("http://localhost:3005/register", {
    nume : this.state.nume,
    prenume : this.state.prenume,
    password : this.state.password,
    confirmareparola : this.state.confirmareparola,
    nr_telefon : this.state.nr_telefon,
    link_poza : this.state.link_poza,
    email : this.state.email
  })
  .then(res => {
    this.loadData();
    return 1;
    }
  )
  .catch(err => {
    alert("Eroare de la server");
    return 0;
  })
}
  }

  render() {
    if(this.newRegister === 1)
    return(
      <Submit/>
    )
    return (
      <div style={headStyle}>
        <div>Pagina de inregistrare</div>
        <div style={containerStyle}>
          <input onChange = {this.uploadData} id = "nume" style={inputStyle} placeholder="Nume" />
          <br />
          <input onChange = {this.uploadData} id = "prenume" style={inputStyle} placeholder="Prenume" />
          <br />
          <input onChange = {this.uploadData} id = "password" style={inputStyle} placeholder="Parola" />
          <br />
          <input  onChange = {this.uploadData} id = "confirmareparola" style={inputStyle} placeholder="Confirmare parola" />
          <br />
          <input onChange = {this.uploadData} id = "nr_telefon" style={inputStyle} placeholder="Numar de telefon" />
          <br />
          <input onChange = {this.uploadData} id = "link_poza" style={inputStyle} placeholder="link pentru poza" />
          <br />
          <input onChange = {this.uploadData} id = "email" style={inputStyle} placeholder="email" />
          <br />
          <button onClick = {this.newRegister}>Inregistrare</button>
        </div>
        <div />
      </div>
    );
    if(this.a)
    return(
      <Submit/>
    )
  }
}

export default Register;
